import React from 'react';
import Section from "../UI/Section/Section";
import './Teams.css'
import TeamMember from "./TeamMember";
import '../../assests/images/1.jpg'
function Teams(props) {
    return (
        <Section title={"our amazing team"} description={"test"} className={"team"}>
            <div className={"team__memebers"}>
                <TeamMember name={'Parveen Anand'} role={'lead designer'} image={'../../assests/images/1.jpg'}/>
                <TeamMember/>
                <TeamMember/>
            </div>
        </Section>
    );
}

export default Teams;
